import React from "react";
import styled from "styled-components";

const StyledLi = styled.li`
  width: 100%;
  list-style: none;
  display: flex;
  align-items: center;
  justify-content: space-around;
`;

const User = () => {
  return (
    <StyledLi>
      <h1>user</h1>
    </StyledLi>
  );
};

export default User;
